  name: 'SidebarLogo',
  props: {
    collapse: {
      type: Boolean,
      required: true
    }
  },
  data() {
    return {
      title: title,
      logo: JSON.parse(Cookies.get('MerInfo')).menu_logo,
      slogo: JSON.parse(Cookies.get('MerInfo')).menu_slogo
    }
  }
}
